    setTimeout(() => {
      setOpenModal(false);
    }, 5000);
  }, []);

  return (
    <>
      <HomeContainer>this is home</HomeContainer>
      {!openModal && <TypingText></TypingText>}
    </>
  );
};
export default Home;
